import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import navbar from "./navbar"
import About from "./About"
function App() {
  return (
    <Router>
      <navbar />
      <Routes>
        <Route path='/welcome' exact component={About} />
      </Routes>
    </Router>
  );
}

export default App;
